import React from 'react';
import { Box, Grid, Typography, Container, Paper } from '@mui/material';
import { motion } from 'framer-motion';
import EnhancedTierCard from './EnhancedTierCard.tsx';
import { TrendingUp, Sparkles, Star } from 'lucide-react';

const EnhancedTierGrid = ({ 
  tiers, 
  isInCart, 
  onAddToCart, 
  onRemoveFromCart,
  getTierColor,
  getTierIcon,
  getTierDescription,
  theme 
}) => {
  if (!tiers || tiers.length === 0) {
    return (
      <Box sx={{ textAlign: 'center', py: 6 }}>
        <Typography variant="h6" color="text.secondary">
          No tiers available for this sub-bundle.
        </Typography>
      </Box>
    );
  }

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1,
        delayChildren: 0.2
      }
    }
  };

  return (
    <Container maxWidth="xl">
      <motion.div
        variants={containerVariants}
        initial="hidden"
        animate="visible"
      >
        {/* Header Section */}
        <motion.div
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
        >
          <Box sx={{ textAlign: 'center', mb: 6 }}>
            <Typography 
              variant="h3" 
              fontWeight="bold" 
              color="text.primary" 
              sx={{ mb: 2 }}
            >
              Choose Your Plan
            </Typography>
            <Typography 
              variant="h6" 
              color="text.secondary" 
              sx={{ mb: 4, maxWidth: 600, mx: 'auto' }}
            >
              Select the perfect plan that matches your security needs. Each tier offers 
              advanced features designed to protect your assets effectively.
            </Typography>

            {/* Feature highlights */}
            <Box sx={{ 
              display: 'flex', 
              justifyContent: 'center', 
              gap: 4, 
              flexWrap: 'wrap',
              mb: 4 
            }}>
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                <Star size={20} color={theme.palette.primary.main} />
                <Typography variant="body2" color="text.secondary">
                  Premium Features
                </Typography>
              </Box>
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                <TrendingUp size={20} color={theme.palette.success.main} />
                <Typography variant="body2" color="text.secondary">
                  Advanced Analytics
                </Typography>
              </Box>
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                <Sparkles size={20} color={theme.palette.warning.main} />
                <Typography variant="body2" color="text.secondary">
                  AI-Powered Security
                </Typography>
              </Box>
            </Box>
          </Box>
        </motion.div>

        {/* Tiers Grid */}
        <Box sx={{ width: '100%' }}>
          <Grid container spacing={4} justifyContent="center">
            {tiers.map((tier, index) => (
              <EnhancedTierCard
                key={tier.id}
                tier={tier}
                index={index}
                isInCart={isInCart(tier.id)}
                onAddToCart={onAddToCart}
                onRemoveFromCart={onRemoveFromCart}
                getTierColor={getTierColor}
                getTierIcon={getTierIcon}
                getTierDescription={getTierDescription}
                theme={theme}
              />
            ))}
          </Grid>
        </Box>

        {/* Bottom CTA Section */}
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.8 }}
        >
          <Paper 
            elevation={2}
            sx={{ 
              mt: 6, 
              p: 4, 
              textAlign: 'center',
              background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
              color: 'white',
              borderRadius: 4
            }}
          >
            <Typography variant="h5" fontWeight="bold" sx={{ mb: 2 }}>
              Ready to Secure Your Assets?
            </Typography>
            <Typography variant="body1" sx={{ mb: 3, opacity: 0.9 }}>
              Join thousands of organizations that trust our advanced security solutions. 
              Get started today and experience the future of protection.
            </Typography>
            <Typography variant="body2" sx={{ opacity: 0.8 }}>
              âœ¨ 24/7 Support â€¢ ðŸ”’ Enterprise Security â€¢ ðŸš€ Instant Deployment
            </Typography>
          </Paper>
        </motion.div>
      </motion.div>
    </Container>
  );
};

export default EnhancedTierGrid;
